import "../scss/navbar.scss";

const Navbar =({categories})=>{
return(
   <div className="header">
<h1>Product List</h1>
<div>
   {categories.map((item)=> (
      <button>{item}</button>
   )
   )}
</div>

</div>
)

}
export default Navbar
